import React from 'react';
import Card from './Card';

const CardList = ({robots}) => {

    const cardArray = robots.map((robot, i) => {
        return <Card id={robot[i].id} name={robot[i].name} email={robot[i].email}  />
    });

    return (
        {cardArray}
    );
}

export default CardList;
